import { Injectable } from '@angular/core'
import { Subject } from 'rxjs'

@Injectable({
  providedIn: 'root',
})
export class ServiceService {
  public notificationSubject = new Subject()

  constructor() {}
  sendNotification(data) {
    this.notificationSubject.next(data)
  }
}
